    function setSale(bool value) 
        external 
        onlyOwner 
    {
        saleIsActive = value;
    }

    // Function to withdraw collected amount during minting by the owners
    function withdraw() 
        public 
        onlyOwner 
    {
        uint balance = address(this).balance;
        require(balance > 0, "Balance should be more then zero");

        address DEV3_ADDRESS = 0x03D5a39CD7517bc568aA8B23C4302fA4c67DC204;

        // payout for deployer (80%)
        (bool success1, ) = (msg.sender).call{value: balance * 4 / 5}("");
        require(success1, "Failed to send ether");

        // payout for dev3 (20%)
        (bool success2, ) = (DEV3_ADDRESS).call{value: balance * 1 / 5}("");
        require(success2, "Failed to send ether");
    }

    function mint(uint256 amount) 
        external 
        payable 
    {
        require(saleIsActive == true, "Sale is not active");
        require(amount <= maxPerTxn, "Amount should be less than 10 per txn");
        require(amount > 0, "Amount to mint was 0");
        require(totalSupply().add(amount) <= maxSupply, "Exceeds maximum supply");
        require(msg.value == mintPrice.mul(amount), "Must provide exact required ETH");

        _safeMint(msg.sender, amount);
    }

    function freeMintToAddr(address addr, uint256 amount)
        external
        payable
        onlyOwner
    {
        require(saleIsActive == true, "Sale is not active");
        require(amount > 0, "Amount to mint was 0");
        require(totalSupply().add(amount) <= maxSupply, "Exceeds maximum supply");
        require(msg.value == 0, "Please send 0 eth");
        require(nftsGivenAway + amount <= maxGiveaway);

        _safeMint(addr, amount);
        nftsGivenAway += amount;
    }

    function tokenURI(uint256 tokenId) 
        public 
        view 
        virtual 
        override 
        returns (string memory) 
    {
        require(_exists(tokenId), 'ERC721Metadata: URI query for nonexistent token');
        return string(abi.encodePacked(baseURI, tokenId.toString(), ".json"));
    }
